import React from "react";

function NavTabs(props) {
  return (
    <ul className="nav nav-tabs">
      <li className="nav-item">
        <a
          href="#home"
          onClick={() => props.handlePageChange("Home")}
          className={props.currentPage === "Home" ? "nav-link active" : "nav-link"}
        >
          Home
        </a>
      </li>
      <li className="nav-item">
        <a
          href="#Listing"
          onClick={() => props.handlePageChange("Listing")}
          className={props.currentPage === "Listing" ? "nav-link active" : "nav-link"}
        >
          Listing
        </a>
      </li>
      <li className="nav-item">
        <a
          href="#Profile"
          onClick={() => props.handlePageChange("Profile")}
          className={props.currentPage === "Profile" ? "nav-link active" : "nav-link"}
        >
          Profile
        </a>
      </li>
      <li className="nav-item">
        <a
          href="#Login"
          onClick={() => props.handlePageChange("Login")}
          className={props.currentPage === "Login" ? "nav-link active" : "nav-link"}
        >
          Login
        </a>
      </li>
    </ul>
  );
}

export default NavTabs;
